import React, { useEffect } from 'react';
import { useNavigate, useLocation, Link } from 'react-router-dom';
import './UploadResult.css';

const UploadResult = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const { status, details } = location.state || { status: 'error', details: { message: 'No upload information available' } };

  useEffect(() => {
    // If user navigates directly to this page without state, redirect to upload page
    if (!location.state) {
      navigate('/upload');
    }
  }, [location.state, navigate]);

  // Determine icon and color based on status
  const isSuccess = status === 'success';
  const icon = isSuccess ? '✓' : '✗';
  const statusClass = isSuccess ? 'success' : 'error';

  return (
    <div className="result-container">
      <div className={`result-card ${statusClass}`}>
        <div className={`result-icon ${statusClass}`}>
          {icon}
        </div>

        <h1 className="result-title">
          {isSuccess ? 'Upload Successful' : 'Upload Failed'}
        </h1>

        {isSuccess ? (
          <div className="result-details">
            <p className="result-message">Your audio has been successfully uploaded.</p>

            {details.title && (
              <div className="detail-item">
                <span className="detail-label">Title:</span>
                <span className="detail-value">{details.title}</span>
              </div>
            )}

            {details.shareWith && (
              <div className="detail-item">
                <span className="detail-label">Shared with:</span>
                <span className="detail-value">{details.shareWith}</span>
              </div>
            )}

            {details.shareType && (
              <div className="detail-item">
                <span className="detail-label">Share method:</span>
                <span className="detail-value">
                  {details.shareType === 'email' 
                    ? 'Email (Compressed)' 
                    : 'App User (Uncompressed)'}
                </span>
              </div>
            )}

            {details.compressionStatus && (
              <div className="detail-item">
                <span className="detail-label">Compression:</span>
                <span className="detail-value">{details.compressionStatus}</span>
              </div>
            )}

            {details.sharingStatus && (
              <div className="detail-item">
                <span className="detail-label">Sharing Status:</span>
                <span className="detail-value">{details.sharingStatus}</span>
              </div>
            )}

            {details.sharingWarning && (
              <div className="detail-item warning">
                <span className="detail-label">Warning:</span>
                <span className="detail-value warning-text">{details.sharingWarning}</span>
              </div>
            )}

            {details.fileName && (
              <div className="detail-item">
                <span className="detail-label">File:</span>
                <span className="detail-value">{details.fileName}</span>
              </div>
            )}

            {details.fileSize && (
              <div className="detail-item">
                <span className="detail-label">Size:</span>
                <span className="detail-value">{details.fileSize}</span>
              </div>
            )}

            {details.uploadDate && (
              <div className="detail-item">
                <span className="detail-label">Date:</span>
                <span className="detail-value">{details.uploadDate}</span>
              </div>
            )}
          </div>
        ) : (
          <div className="result-details">
            <p className="result-message error-message">
              {details.message || 'An unknown error occurred during upload.'}
            </p>
            {details.suggestion && (
              <p className="suggestion">{details.suggestion}</p>
            )}
          </div>
        )}

        <div className="result-actions">
          <Link to="/upload" className="action-button secondary">
            Upload Another
          </Link>
          <Link to="/" className="action-button primary">
            Go Home
          </Link>
        </div>
      </div>
    </div>
  );
};

export default UploadResult;
